import {
    UilEstate,
    UilClipboardAlt,
    UilUsersAlt,
    UilPackage,
    UilChart,
    UilSignOutAlt
} from '@iconscout/react-unicons'; 

export const SidebarData = [
    {
        icon: UilEstate,
        heading: 'Dashboard'
    },
    {
        icon: UilClipboardAlt,
        heading: 'Orders'
    },
    {
        icon: UilUsersAlt,
        heading: 'Customers'
    },
    {
        icon: UilChart,
        heading: 'Analytics'
    },
    {
        icon: UilPackage,
        heading: 'Products'
    }
]
